import React from 'react';
import { useNavigate } from 'react-router-dom'; // Importando o useNavigate
import './home.css'; // Importando o arquivo CSS
import Img1 from '../../assets/img1.png';
import Img2 from '../../assets/img2.png';

const Home = () => {
  const navigate = useNavigate(); // Usando useNavigate

  const redirectToFeedback = () => {
    navigate('/feedback'); // Usando navigate para redirecionar
  };
  

  return (
    <div className="home-container">
      <h1 className="home-title">Bem-vindo ao Salão de Beleza Dondokas</h1>
      <p className="home-description">
        O Salão Dondokas oferece uma experiência única para cuidar de sua beleza, com uma variedade de serviços de cabelo, unhas e estética. Nossos profissionais são altamente qualificados e dedicados a oferecer o melhor atendimento. Venha nos visitar e sinta-se renovado!
      </p>

      <p className="home-address">
        Endereço: Rua das Flores, 123, Centro - Cidade, Estado
      </p>

      <p className="home-hours">
        Horário de funcionamento: Segunda a Sexta, das 9h às 18h.
      </p>

      <button onClick={redirectToFeedback} className="home-button">
        Deixe seu Feedback
      </button>

      <div className="home-images">        
        <img src={Img1} alt="Serviço 1" />
        <img src="url_da_imagem2.jpg" alt="Serviço 2" />
        <img src="url_da_imagem3.jpg" alt="Serviço 3" />
        <img src="url_da_imagem4.jpg" alt="Serviço 4" />
      </div>
    </div>
  );

};

export default Home;
